import React from "react";

const Nav = () => {
  return (
    <div>
      <ul class="bg-[#DA1E55] py-[25px] mb-[25px] flex justify-around fixed w-screen">
        <li>List Item 1</li>
        <li>List Item 2</li>
        <li>List Item 3</li>
      </ul>
    </div>
  );
};

export default Nav;
